         <p>SHIVAKI mini pechi ishtahani ochuvchi qarsillab tovuqni tezda pishirish uchun
            yetarli quvvatga ega. Bundan tashqari, ba'zi oziq-ovqatlarni qayta ishlash
            uchun isitish rejimlaridan birini tanlashingiz mumkin. Ushbu model tezda
            maksimal harorat belgisiga qadar qiziydi. Ish xonasining katta hajmi tufayli
            siz butun oila va mehmonlar uchun to'liq tushlik yoki kechki ovqat
            tayyorlashingiz mumkin. Mini-pechning korpusi po'latdan yasalgan, mexanik
            kuchlanish va yuqori haroratga chidamli. Bundan tashqari, to'plam panjara,
            sirlangan to'rtburchaklar va chuqur dumaloq pishirish patnislari bilan birga
            keladi. O'zining oqlangan dizayni tufayli Mini pech har qanday oshxona
            interyerida ajoyib ko'rinadi.</p>
